
drop table if exists EM_LOT;
CREATE TABLE IF NOT EXISTS EM_LOT (
  LOTID varchar(64) NOT NULL primary key,
  ITEMID varchar(64) NOT NULL,
  "STATE" varchar(64) NOT NULL,
  QUANTITY int DEFAULT NULL,
  OPERATIONID varchar(64) DEFAULT NULL,
  EQUIPMENTID varchar(64) DEFAULT NULL,
  STARTDATETIME timestamp DEFAULT NULL,
  ENDDATETIME timestamp DEFAULT NULL,
  APPLIED_TACTTIME float DEFAULT NULL
);
